import React, {Component} from 'react';
import './about.css';


class AboutComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
          height: props.height,
          scrollTo: props.height
        };
      //this.handle = this.handle.bind(this);
    }

}
